--
-- Name: check_appointment_conflict(text, date, time without time zone, time without time zone, uuid); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.check_appointment_conflict(p_therapist_id text, p_date date, p_start_time time without time zone, p_end_time time without time zone, p_exclude_id uuid DEFAULT NULL::uuid) RETURNS boolean
    LANGUAGE plpgsql
    AS $$
DECLARE
  v_conflict INTEGER := 0;
BEGIN
  SELECT COUNT(*) INTO v_conflict
  FROM appointments
  WHERE therapist_id = p_therapist_id
    AND date = p_date
    AND status NOT IN ('cancelado', 'paciente_faltou')
    AND (p_exclude_id IS NULL OR id != p_exclude_id)
    AND (
      (start_time < p_end_time AND end_time > p_start_time)
    );

  RETURN v_conflict > 0;
END;
$$;


